INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 4, 4, 24015, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 4, 1, 24016, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 4.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 4, 4, 24017, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 1, 2, 24018, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 5.2, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 5, 6, 24019, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 4.2, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 2, 2, 24020, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 1, 6, 24021, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 6.4, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 2, 2, 24022, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 6, 3, 24023, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 10.08, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 1, 2, 24024, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 5.0, 0.0, "カオリ（サマー）", 24);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (110501, 10021, 0.0, "2019/07/31 12:00:00", 2, 2, 24025, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 24);
